SELECT MIN("title"."id") as agg_0 FROM "name" LEFT OUTER JOIN "aka_name" ON "name"."id" = "aka_name"."person_id" LEFT OUTER JOIN "cast_info" ON "aka_name"."id" = "cast_info"."person_id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id" LEFT OUTER JOIN "title" ON "cast_info"."movie_id" = "title"."id" LEFT OUTER JOIN "movie_companies" ON "title"."id" = "movie_companies"."movie_id" LEFT OUTER JOIN "person_info" ON "name"."id" = "person_info"."person_id" LEFT OUTER JOIN "kind_type" ON "title"."kind_id" = "kind_type"."id" LEFT OUTER JOIN "movie_keyword" ON "title"."id" = "movie_keyword"."movie_id" LEFT OUTER JOIN "company_name" ON "movie_companies"."company_id" = "company_name"."id" LEFT OUTER JOIN "keyword" ON "movie_keyword"."keyword_id" = "keyword"."id"  WHERE ("name"."imdb_index" LIKE '%III%' OR ("name"."imdb_index" IN ('V', 'IX') AND "name"."imdb_index" != '%LXVI%')) AND ("person_info"."id" BETWEEN 1729560 AND 2557972 OR ("person_info"."person_id" <= 55760 AND "person_info"."id" >= 2808163)) AND ("name"."gender" = '%f%' OR "name"."id" >= 3268423) AND "kind_type"."kind" IN ('tv series', 'tv movie', 'tv mini series') AND "cast_info"."note" NOT LIKE '%(%voice)%' AND "keyword"."phonetic_code" LIKE '%R%1652%' AND "char_name"."id" IS NOT NULL AND "company_name"."id" IS NOT NULL;